import React, { Component } from "react";

class CadastroProduto extends Component {
  constructor(props) {
    super(props);

    this.state = {
      listProducts: "",
    };
  }
  componentDidMount() {
    if (this.props.location.list) {
      alert("entrei");
      console.log(this.props.location.list.products);
      this.setState({
        listProducts: this.props.location.list.products,
      });
      console.log(this.state.listProducts);
    }
  }

  render() {
    return <div></div>;
  }
}
export default CadastroProduto;
